import { LOGIN, SIGNOUT} from "./Action"

const initialState = {
    isloggedIn: false,
    user: ""
  }

const Reducer = (state = initialState, action) => {
    switch (action.type) {
        case LOGIN:
            console.log(action.payload)
            return state

        case SIGNOUT:
            return state

        default:
            return state;
    }
}

export default Reducer
